import React from 'react';
import styled from 'styled-components';
import { ReactComponent as KeyIcon } from '../../images/assets/icons/key.svg';

const StyledButton = styled.button`
  display: flex;
  align-items: center;
  padding: 10px;
  background: transparent;
  border: none;
  cursor: pointer;
  transition: background-color 0.3s ease;

  &:hover {
    background-color: #f0f0f0;
  }
`;

const Icon = styled.span`
  display: flex;
  align-items: center;
  justify-content: center;
  width: 24px;
  height: 24px;

  svg {
    fill: white; /* Couleur par défaut du SVG */
    transition: fill 0.3s ease;
  }

  ${StyledButton}:hover & svg {
    fill: #ff4500; /* Couleur du SVG au survol */
  }
`;

const Button = ({ icon, label, onClick }) => {
  return (
    <StyledButton onClick={onClick}>
      <Icon>{icon}</Icon>
      <span style={{ marginLeft: '8px', color: 'white' }}>{label}</span>
    </StyledButton>
  );
};

const NavbarLeft = () => {
  return (
    <div>
      <Button icon={<KeyIcon />} label="Truth & Dare" />
      {/* Autres boutons */}
    </div>
  );
};

export default NavbarLeft;
